            if (node.getLeft()) {
                this._removeBT(node.getLeft(), value, node);
            } else {
                return false;
            }
        } else if (value > node.getValue()) {
            if (node.getRight()) {
                this._removeBT(node.getRight(), value, node);
            } else {
                return false;
            }
        } else {
            if (node.isLeaf()) {
                if (parent.getLeft() === node) {
